import { BrowserRouter } from "react-router-dom";
import { ThemeProvider } from "styled-components";
import Main from "./Pages/Main";

const appTheme = {
  colors: { primary: "#fdc838" },
};

function App() {
  return (
    <ThemeProvider theme={appTheme}>
      <BrowserRouter>
        <Main />
      </BrowserRouter>
    </ThemeProvider>
  );
}

export default App;
